css:
@-moz-document domain("fonts.google.com") {
.t-white, .t-white body, .t-white #main, .t-white .font-preview-headers, .t-white .font-preview-controls {
    background: #392c2c;
}
.t-white .gf-header .gf-header-content, .t-white .nav-panel-header {
    background: #9c7575;
}
.t-white .fonts-module-title, .t-white .font-preview-text {
    color: rgba(255, 233, 233, .87);
}
.t-white .fonts-module-subtitle {
    color: rgba(255, 233, 233, .6);
}
.global-toolbar-menu-button-text {
    color: #f0c8c8;
}
gf-toolbar-text-modifier md-input-container.md-block .md-input {
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    width: 100%;
    font-family: Roboto,"Helvetica Neue",sans-serif;
    font-size: 15px;
    color: #f0c8c8;
}
.is-catalog-page .global-toolbar-font-preview-wrapper .search-panel-query {
    color: #f0c8c8;
}
body.md-default-theme, body, html.md-default-theme, html {
    color: rgba(255, 207, 207, 0.87);
}
.toolbar-filter-item-button {
    -webkit-border-radius: 20px;
    border-radius: 20px;
    border: 1px solid #f9e4f3;
    color: #bb7777;
}
.is-catalog-page .global-bar-fixed-to-top .global-toolbar-top-area {
    background: #000;
    border: 0;
    border-top: 1px solid #52454a;
    border-bottom: 1px solid #52454a;
}
}
